<h1>CANBUS Frequency</h1>
<h2>Units: [kilobits per second]</h2>

<p>This specifies what baud-rate the <a href="acc_canbus.html">CANBUS</a> interface operates at. The following baud-rates are supported:
<ul><li>
<p>125 Kbps</p>
</li><li>
<p>250 Kbps</p>
</li><li>
<p>500 Kbps</p>
</li><li>
<p>1000 Kbps</p>
</li></ul>
</p>
